import { useState } from "react";
import { useHistory } from "react-router-dom";
import styles from "../home.module.css";

function App() {
  const history = useHistory();

  const [Name, setName] = useState("");
  const [SellerId, setSellerId] = useState("");
  const [Manager, setManager] = useState("");
  const [MgrId, setMgrId] = useState("");
  const [Address, setAddress] = useState("");
  const [Brand, setBrand] = useState("");
  const [Seller, setSeller] = useState("");

  async function AddSeller(event) {
    event.preventDefault();

    const response = await fetch(
      "/channels/mychannel/chaincodes/smartContract",
      {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: "Bearer " + window.token,
        },
        body: JSON.stringify({
          fcn: "createSeller",
          peers: ["peer0.org1.example.com", "peer1.org2.example.com"],
          chaincodeName: "smartContract",
          channelName: "mychannel",
          args: [Seller, Name, SellerId, Manager, MgrId, Address, Brand],
        }),
      }
    );

    console.log("HELLO");
    const data = await response.json();
    console.log(data);
    if (data.status === "ok") {
      window.location.href = "/addproduct";
    } else {
      alert("Please check the entered data");
    }
  }

  return (
    <div>
      <div class={styles.topnav}>
        <a href="/">Home</a>
        <a href="register">Register</a>
        <a href="login">Login</a>
        <a href="changeowner">Change Owner</a>
        <a href="authenticate">Authenticate</a>
        <a href="addproduct">Add Product</a>
        <a class={styles.active} href="addseller">
          Add Seller
        </a>
      </div>
      <h1>Add Seller</h1>
      <form onSubmit={AddSeller}>
      <input
          value={Seller}
          onChange={(e) => setSeller(e.target.value)}
          type="text"
          placeholder="Seller Number"
        />
        <br />
        <input
          value={Name}
          onChange={(e) => setName(e.target.value)}
          type="text"
          placeholder="Seller Name"
        />
        <br />
        <input
          value={SellerId}
          onChange={(e) => setSellerId(e.target.value)}
          type="text"
          placeholder="Seller ID"
        />
        <br />
        <input
          value={Brand}
          onChange={(e) => setBrand(e.target.value)}
          type="text"
          placeholder="Brand"
        />
        <br />
        <input
          value={Manager}
          onChange={(e) => setManager(e.target.value)}
          type="text"
          placeholder="Manager"
        />
        <br />
        <input
          value={MgrId}
          onChange={(e) => setMgrId(e.target.value)}
          type="text"
          placeholder="Manager Id"
        />
        <br />
        <input
          value={Address}
          onChange={(e) => setAddress(e.target.value)}
          type="text"
          placeholder="Address"
        />
        <br />
        <input type="submit" value="Add Seller" />
      </form>
    </div>
  );
}

export default App;
